export class Hys {

    id!: number;
    html: number;
    bootstrap: number;
    angular: number;
    mysql: number;
    java: number;
    springboot: number;

    constructor(html: number, bootstrap: number, angular: number, mysql: number, java: number, springboot: number){
        this.html = html;
        this.bootstrap = bootstrap;
        this.angular = angular;
        this.mysql = mysql;
        this.java = java;
        this.springboot = springboot;
    }

}
